    return (
        <>

            <div className="block p-4 pl-10 w-1/3 text-m text-black bg-[#F2F61E] rounded-full focus:ring-blue-500  dark:bg-gray-700  dark:placeholder-white dark:text-white dark:focus:ring-blue-500">
                <Font family='Monoton'>
                    <Text>
                        {message}
                    </Text>

                </Font>
            </div>

        </>
    )
}
export default Scrunch;
